import React, {useState} from 'react';
import Teammates from "./List.js";
import Form from "./Form.js";
import './App.css';

function App() {
  const Teammates = [];


  return (
    <div>
      <Form Teammates={Teammates} />
      <div>
        <h1>Team: </h1>
        {Teammates.map( mate => {
          return (
            <div>
              <p>Name: {mate.Name}</p>
              <p>Email: {mate.Email}</p>
              <p>Role: {mate.Role}</p>
            </div>
          )
        })}

      </div>
    </div>
  );
}

export default App;
